Fake (2010)

Daniel Jakor is one of the most prolific and successful artists the world has never heard of. Struggling to sell his own art, he soon finds his true genius lies not in the creation of his own work but in the forgery of the great masters that have come before him- artists like Picasso, Monet, Degas and Renoir. And with the help of a Tay Murphy, corrupt gallery owner in Boston, Daniel soon learns the intricacies of the art world as he becomes a true master himself. But Tay's life is spiraling out of control and his personal demons have brought him to the edge where he hangs on by a thread. Indebted to the mob for more than he can possibly pay back, Tay gets Daniel roped into working for Seamus White, the head of the Irish &quot;family&quot; in New England and an avid art collector. As Seamus's schemes become bolder and bolder, not only pushing the boundaries of Daniel's ability but the limits of forgery itself...             

